"""
Given two strings A and B of lowercase letters, return true if and only if we can swap two letters in A so that the result equals B.

Example 1:

    Input: A = "ab", B = "ba"
    Output: true

Example 2:

    Input: A = "ab", B = "ab"
    Output: false

Example 3:

    Input: A = "aa", B = "aa"
    Output: true

Example 4:

    Input: A = "aaaaaaabc", B = "aaaaaaacb"
    Output: true

Example 5:

    Input: A = "", B = "aa"
    Output: false

Constraints:

    0 <= A.length <= 20000
    0 <= B.length <= 20000
    A and B consist only of lowercase letters.
"""
import pytest


class Solution:
    def buddyStrings(self, A: str, B: str) -> bool:
        if len(A) != len(B):
            return False
        if sorted(A) != sorted(B):
            return False

        diffA = []
        diffB = []
        for cA, cB in zip(A, B):
            if cA != cB:
                diffA.append(cA)
                diffB.append(cB)
        diffA = "".join(diffA)
        diffB = "".join(diffB)
        if diffA and len(diffA) != len(A) and self.buddyStrings(diffA, diffB) is False:
            return False

        for distance in range(1, len(A)):
            for i in range(len(A) - distance):
                j = i + distance
                swapped = list(A)
                swapped[i] = A[j]
                swapped[j] = A[i]
                if "".join(swapped) == B:
                    return True
        return False


@pytest.mark.timeout(8)
def test():
    s = Solution()

    assert s.buddyStrings("ab", "ba") is True
    assert s.buddyStrings("ab", "ab") is False
    assert s.buddyStrings("aa", "aa") is True
    assert s.buddyStrings("aaaaaaabc", "aaaaaaacb") is True
    assert s.buddyStrings("", "aa") is False
    assert s.buddyStrings("abab", "abab") is True
    assert s.buddyStrings("abcabc", "abcabc") is True

    A = ""
    B = ""
    assert s.buddyStrings(A, B) is True

    A = ""
    B = ""
    assert s.buddyStrings(A, B) is False
